    var margin = {
        top: 10,
        right: 10,
        bottom: 170,
        left: 10
      },
      margin2 = {
        top: 350,
        right: 10,
        bottom: 120,
        left: 10
      },
     /* width = 1200 - margin.left - margin.right,*/
		 width = parseInt(d3.select(".bar_chart").style("width")) - margin.left - margin.right,
      height = 400 - margin.top - margin.bottom,
      height2 = 500 - margin2.top - margin2.bottom;

    var x = d3.scaleBand()
      .domain(data.map(function(d) {return d.StockSymbol}))
      .range([0, width]);

    var x2 = d3.scaleBand()
      .domain(data.map(function(d) {return d.StockSymbol}))
      .range([0, width]);

    var y = d3.scaleLinear()
    /*  .domain([0, d3.max(data, function(d) {
        return d.Value
      })])*/
	 .domain([0,100, d3.max(data, function(d) { return d.Value;})])
      .range([height, 0]);

    var y2 = d3.scaleLinear()
      .domain([0,100, d3.max(data, function(d) { return d.Value;})])
      .range([height2, 0]);

    var brush = d3.brushX()
      .extent([[0, 0],[width, height2]])
     /* .on("brush", brushed);*/
 .on("start brush end", brushed);
    var zoom = d3.zoom()
      .scaleExtent([1, Infinity])
      .translateExtent([[0, 0],[width, height] ])
      .extent([[0, 0],[width, height]])
      .on("zoom", zoomed);

    var svg = d3.select(".bar_chart")
      // .data(data)
      .append("svg")
      .attr("width", width + margin.left + margin.right)
      .attr("height", height + margin.top + margin.bottom);


  svg.append("rect")
    .attr("class", "zoom")
    .attr("width", width)
    .attr("height", height)
    .attr("transform", "translate(" + margin.left + "," + margin.top + ")")
    .call(zoom);
	  
    svg.append("defs")
      .append("rect")
      .attr("width", width)
      .attr("height", height);

    var focus = svg.append("g")
      .attr("class", "focus")
      .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

    var context = svg.append("g")
      .attr("class", "context")
      .attr("transform", "translate(" + margin2.left + "," + margin2.top + ")");

   

    var xAxis = d3.axisBottom(x);
    var xAxis2 = d3.axisBottom(x2);
	  
	  

    focus.append("g")
      .attr("class", "x axis")
	  .attr("opacity", 0)
      .call(xAxis);

    // Add the Y Axis
    focus.append("g")
      .attr("class", "axis").attr("opacity", 0)
      .call(d3.axisLeft(y)
        );


var Tooltip = d3.select("body")
.append("div")
.style("opacity", 0)
.attr("class", "tooltip")
	  
var mouseover = function(d) {
Tooltip
.style("opacity", 1)
d3.select(this)
.style("opacity", 1)
}

var mousemove = function(d) {
Tooltip
.text(d.StockSymbol + ":" + d.Value)
.style("left", (d3.mouse(this)[0]+100) + "px")
.style("top", (d3.mouse(this)[1]+110) + "px")
.style("font-weight", "600").style("font-size", "13px")
}
var mouseleave = function(d) {
Tooltip
.style("opacity", 0)
d3.select(this) 
}



    var focus_group = focus.append("g");
    focus_group.attr("clip-path", "url(#clip)");

    var rects = focus_group.selectAll('rect')
      .data(data);

    //********* Bar Chart 1 ****************
    var newRects1 = rects.enter();

    newRects1.append('rect')
      .attr('class', 'bar mainBars')
      .attr('x', function(d, i) {
        return x(d.StockSymbol);
      })
      .attr('y', function(d, i) {
        return y(d.Value);
      })
      .attr('height', function(d, i) {
        return height - y(d.Value)
      })
      .attr("width", function(d,i)
			 { return x.bandwidth() })
	  .on("mouseover", mouseover)
		.on("mousemove", mousemove) 
		.on("mouseleave", mouseleave);
     

    var focus_group = context.append("g");
    focus_group.attr("clip-path", "url(#clip)");

    var brushRects = focus_group.selectAll('rect')
      .data(data);

    //********* Brush Bar Chart ****************
    var brushRects1 = brushRects.enter();

    brushRects1.append('rect')
      .attr('class', 'bar mainBars')
      .attr('x', function(d, i) {
        return x2(d.StockSymbol);
      })
      .attr('y', function(d, i) {
        return y2(d.Value);
      })
      .attr('height', function(d, i) {
        return height2 - y2(d.Value)
      })
	  .attr("fill", function(d) {
	if (d.Value < 50){
		return "#FE3957";
	} else {
		return "#0CAF82";
	}})
      .attr("width", function(d,i)
			 { return x.bandwidth() })
    
	  .on("mouseover", mouseover)
		.on("mousemove", mousemove) 
		.on("mouseleave", mouseleave);

    //append brush xAxis2
    context.append("g")
      .attr("class", "axis x-axis").attr("opacity", 0)
      .attr("transform", "translate(0," + height2 + ")")
      .call(xAxis2);

    context.append("g")
      .attr("class", "brush")
      .call(brush)
      .call(brush.move, x.range());





    //create brush function redraw scatterplot with selection
    function brushed() {
      if (d3.event.sourceEvent && d3.event.sourceEvent.type === "zoom") return; // ignore brush-by-zoom
		   // get bounds of selection
      var s = d3.event.selection,
        nD = [];
      x2.domain().forEach((d) => {
        var pos = x2(d) + x2.bandwidth() / 2;
        if (pos > s[0] && pos < s[1]) {
          console.log(nD);
          nD.push(d);
        }
      });

      x.domain(nD);
 focus.selectAll(".mainBars")
        .style("opacity", function(d) {
          return x.domain().indexOf(d.StockSymbol) === -1 ? 0 : 100;
        })
		.attr("fill", function(d) {
	if (d.Value <= 50){ 
		return "#FE3957";
	} else {
		return "#0CAF82";
	}})
		
        .attr("x", function(d) {
          return x(d.StockSymbol) + x.bandwidth() / 2 ;
        })
        .attr("y", function(d) {
          return y(d.Value);
        })
        .attr("height", function(d, i) {
          return height - y(d.Value)
        })
        .attr("width", function(d,i)
			 { return x.bandwidth() })
.attr("y", function(d) {

if (d.Value > 50){
	return y(d.Value);
} else {
	return y(0);
}
})
   

     
focus.select(".x.axis").call(xAxis);
}
function zoomed() {
	
	var zoomFactor = 1.25;
	
    if (d3.event.deltaY > 0) {
        viewport.size = Math.min(
            data.length,
            viewport.size * zoomFactor
        );
    } else if (d3.event.deltaY < 0) {
        viewport.size = Math.round(
            Math.max(1,
                viewport.size / zoomFactor
            ));
    }
      if (d3.event.sourceEvent && d3.event.sourceEvent.type === "brush") return; // ignore zoom-by-brush
      var t = d3.event.transform;
      x.domain(t.rescaleX(x2).domain());

	focus.selectAll(".mainBars")
      .attr("x", function(d) {
        return x(d.StockSymbol);
      })
      .attr("y", function(d) {
        return y(d.Value);
      })
      .attr("width", function(d) {
        return x.bandwidth();
      })
      .attr("height", function(d) {
        return height - y(d.Value);
      })
      
       
.attr("y", function(d) {

if (d.Value > 50){
	return y(d.Value);
} else {
	return y(0);
}
})
   

      focus.select(".x-axis").call(xAxis);
      context.select(".brush").call(brush.move, x.range().map(t.invertX, t));
	
	svg.select(".zoom").call(zoom.transform, d3.zoomIdentity
      .scale(width / (s[1] - s[0]))
      .translate(-s[0], 0));
	var e = d3.event.selection;
    var selectedrects = focus.selectAll('.mainBars').filter(function() {
      var xValue = this.getAttribute('x');
      return e[0] <= xValue && xValue <= e[1];
    });
	
	
    }
